import React, { Fragment } from "react";
import logo from './logo.svg';
import './App.css';

//components

import InputBooks from "./components/inputbooks";
import ListBooks from "./components/listbooks";

function App() {
  return <Fragment>
    <div className="container">
      <InputBooks/>
      <ListBooks/>
    </div>
  </Fragment>;
}

export default App;
